import React from "react";
import Todo from './Todo';

const todos = [
  { id: 1, message: 'Be confident' },
  { id: 2, message: 'Shoulders back' },
  { id: 3, message: 'Chin towards God' }
]

function TodoList() {
    return(
        <div>
            { todos.map(todo => {
                return <Todo todo={todo} />
            }) }
        </div>
    )
}

export default TodoList;
